import React from "react";
import axios from "axios";
import { useState } from 'react';

export const Reference = () => {
  const [content, setContent] = useState([{}]);

  const contentName = window.location.pathname;
  console.log(`${process.env.REACT_APP_URL_SERVER}${contentName}`)

  axios.get(`${process.env.REACT_APP_URL_SERVER}${contentName}`)
  .then(response => {
    setContent(response.data.content)
  })
  return (
    <ul>
        { content.length > 0 ?
          this.state.persons
            .map(content =>
              <li key={content.symbol}>{content.symbol}</li>
            )

            :

            <p>NO CONTENT</p>
        }
      </ul>
  );
};
